import React, { useState } from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import './Mentors.css'

import Mentor1 from "../assets/images/Mentor1.png";
import Mentor2 from "../assets/images/Mentor2.png";
import Mentor3 from "../assets/images/Mentor3.png";
import Mentor4 from "../assets/images/Mentor4.png";
import Mentor5 from "../assets/images/Mentor5.png";

const mentorData = [
  { image: Mentor1, title: 'Card One', text: 'Lorem ipsum dolor sit amet consectetur, adipisicing elit. Illum culpa natus velit voluptatem fuga, quas atque numquam accusantium eius doloremque sapiente, saepe eos exercitationem, ad necessitatibus a? Neque, deserunt qui!' },
  { image: Mentor2, title: 'Card Two', text: 'Lorem ipsum dolor sit amet consectetur, adipisicing elit. Illum culpa natus velit voluptatem fuga, quas atque numquam accusantium eius doloremque sapiente, saepe eos exercitationem, ad necessitatibus a? Neque, deserunt qui!' },
  { image: Mentor3, title: 'Card Three', text: 'Lorem ipsum dolor sit amet consectetur, adipisicing elit. Illum culpa natus velit voluptatem fuga, quas atque numquam accusantium eius doloremque sapiente, saepe eos exercitationem, ad necessitatibus a? Neque, deserunt qui!' },
  { image: Mentor4, title: 'Card Four', text: 'Lorem ipsum dolor sit amet consectetur, adipisicing elit. Illum culpa natus velit voluptatem fuga, quas atque numquam accusantium eius doloremque sapiente, saepe eos exercitationem, ad necessitatibus a? Neque, deserunt qui!' },
  { image: Mentor5, title: 'Card Five', text: 'Lorem ipsum dolor sit amet consectetur, adipisicing elit. Illum culpa natus velit voluptatem fuga, quas atque numquam accusantium eius doloremque sapiente, saepe eos exercitationem, ad necessitatibus a? Neque, deserunt qui!' },
];

export const Mentors = () => {
  const settings = {
    infinite: true,
    speed: 500,
    slidesToShow: 1,  // Змінено на 1, щоб виводити по одному елементу за раз
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 1000,
  };

  const [isHovered, setIsHovered] = useState(false);

  const handleMouseEnter = (index) => {
    setIsHovered(index);
  };

  const handleMouseLeave = () => {
    setIsHovered(null);
  };

  return (
    <div className='partners'>
      <h1>MENTORS</h1>
      <Slider {...settings}>
        {mentorData.map((mentor, index) => (
          <div key={index}>
            <div className='card'>
              <div className={`imgBX ${isHovered === index ? 'enlarged' : ''}`}>
                <img src={mentor.image} alt={`Зображення ${index + 1}`} />
              </div>
              <div className='content'>
                <h2>{mentor.title}</h2>
                <p>{mentor.text}</p>
              </div>
            </div>
          </div>
        ))}
      </Slider>
      
      <p>
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Sint enim iste
        tenetur nam dolorem, accusamus ratione numquam facilis sequi minima fuga
        possimus eius sit earum, nihil magni? Voluptate, perspiciatis soluta.
      </p>
    </div>
  );
};
